function AgregarNuevoElemento(){$("#btn-agregar").on("click",function(){objVariables.Tipo===objConstConfigGeneral.TipoColeccionN2&&(objNuevo.valor=$("#text-valor").val(),objListado.filtro=objListado.datos.filter(function(n){return n.valor===objNuevo.valor}).length,objListado.filtro+=objListado.actual.filter(function(n){return n===objNuevo.valor}).length,objListado.filtro===0&&(objNuevo.valor.length>0?(objListado.datos.push({valor:objNuevo.valor}),PintarElementos(),$("#text-valor").val("")):console.log("falta2")))})}function PintarElementos(){$("#contiene-listado").empty();$.each(objListado.datos,function(n,t){objVariables.Tipo===objConstConfigGeneral.TipoColeccionN2&&$("#contiene-listado").append($('<div class="form-check"><button type="button" class="btn btn-link text-primary btn-borrar" data-index="'+n+'" title="Eliminar"><i class="far fa-trash-alt"><\/i><\/button><input type="hidden" id="Nuevo_'+n+'__Estado" name="Nuevo['+n+'].Estado" value="True"><input type="hidden" id="Nuevo_'+n+'__Id" name="Nuevo['+n+'].Id" value="0"><input type="hidden" id="Nuevo_'+n+'__Valor" name="Nuevo['+n+'].Valor" value="'+t.valor+'" class="valor-nuevo"><label class="form-check-label">'+t.valor+"<\/label><\/div>"))})}function EliminarElemento(){$("#contiene-listado").on("click",".btn-borrar",function(){objListado.datos.splice($(this).data("index"),1);PintarElementos()})}function CargaInicial(){objListado.actual=[];$("#contiene-listado-actual .form-check input.valor-actual").each(function(){objListado.actual.push($(this).val())});objVariables.Tipo===objConstConfigGeneral.TipoColeccionN2&&$("#contiene-listado .form-check input.valor-nuevo").each(function(){objListado.recordado=$(this).val();objListado.datos.push({valor:objListado.recordado})})}var objWebRoot={route:""},objUser={username:"",usersession:""},objConstConfigGeneral={TipoColeccionN1:$("#TipoColeccionN1").val(),TipoColeccionN2:$("#TipoColeccionN2").val()},objVariables={Tipo:$("#Tipo").val()},objListado={datos:[],actual:[],filtro:[],recordado:[]},objNuevo={valor:""};$(function(){objWebRoot.route=$("#routeWebRoot").val();objUser.username=$("#user").text();objUser.usersession=$("#FolioSession").val();CargaInicial();AgregarNuevoElemento();EliminarElemento()});